  return (
    <>
      <section className="showcase login">
        <div className="showcase-overlay">
          <form className="form-control">
            <input
              type="username"
              name="username"
              id="username"
              placeholder="Your username"
              required
            />
            <input
              type="password"
              name="password"
              id="password"
              placeholder="Your password"
            />
            <button type="submit">Log In</button>
          </form>
        </div>
      </section>
    </>
  );
};

export default Login;
